int main() {
    int n;
    cin >> n;
    vector<int> A(n);
    for (int i = 0; i < n; ++i) {
        cin >> A[i];
    }
    vector<int> B(n);
    stack<int> stacc;

    for (int i = 0; i < n; ++i) {
        while (!stacc.empty() && stacc.top() > A[i]) stacc.pop();
        if (stacc.empty()) cout<< 0 << " ";
        else cout << stacc.top() << " ";
        stacc.push(A[i]);
    }
    return 0;
}
